/** 宛先情報
 * @typedef Recipient
 * @prop {string} recipient - 宛先のe-mailアドレス
 * @prop {string} subject - 題名
 * @prop {string} body - 本文(プレーンテキスト)
 * @prop {string} name - 発信者名
 * @prop {string} htmlBody - 本文(HTML)
 * @prop {string} replyTo - 返信先アドレス
 * @prop {Object.<string, string>} embed - 埋込データ
 */

/**
 * @typedef BulkMail
 * @prop {Object.<string, string>} templates - テンプレート名と本文。_[0-9a-zA-Z]は埋込キー
 * @prop {Recipient[]} list - 宛先情報の配列
 */

/**
 * - [GmailApp.createDraft](https://developers.google.com/apps-script/reference/gmail/gmail-app?hl=ja#createDraft(String,String,String,Object))
 */
function BulkMail(){
  const v = {whois:'BulkMail',rv:null,step:0};
  console.log(v.whois+' start.');
  try {
  
    for( v.i=0 ; v.i<arg.list.length ; v.i++ ){
      v.step = 1; // メールオブジェクト(v.mail)の作成
      v.o = arg.list[v.i];
      v.mail = {
        recipient: v.o['メールアドレス'], //	String	受信者のアドレス
        subject: '[連絡] 校庭キャンプ2023抽選結果', //	String	件名
        body: arg.templates[v.o.template].text, //	String	メールの本文
        options: {
          //attachments: [], //	BlobSource[]	メールで送信するファイルの配列
          //bcc	String	BCC 宛てのメールアドレスのカンマ区切りリスト
          //cc	String	Cc に含めるメールアドレスのカンマ区切りリスト
          //from	String	メールの送信元のアドレス（getAliases() によって返された値のいずれか）
          //htmlBody	String	設定すると、HTML をレンダリングできるデバイスでは、必須の本文引数の代わりに、HTML をレンダリングします。メールのインライン画像がある場合は、HTML 本文にオプションの inlineImages フィールドを追加できます。
          //inlineImages	Object	画像キー（String）から画像データ（BlobSource）へのマッピングを含む JavaScript オブジェクト。これは、htmlBody パラメータが使用され、これらの画像への参照が <img src="cid:imageKey" /> 形式で含まれていることを前提としています。
          name: '下北沢小おやじの会', //	String	メールの送信者の名前（デフォルト: ユーザーの名前）
          replyTo: 'shimokitasho.oyaji@gmail.com',  //	String	デフォルトの返信先アドレスとして使用するメールアドレス（デフォルト: ユーザーのメールアドレス）
        }
      }

      v.step = 2; // 埋込情報の処理
      for( v.j=0 ; v.j<arg.templates[v.o.template].embed.length ; v.j++ ){
        v.key = arg.templates[v.o.template].embed[v.j];
        v.mail.body = v.mail.body.replaceAll(new RegExp('_'+v.key,'g'),v.o[v.key]);
      }
      v.step = 3; // 個人宛連絡の追加
      if( v.o.note ){
        v.mail.body += '\n\n\n\n追伸\n\n' + v.o.note;
        console.log(v.mail);
      }

      v.step = 4; // メールの送信
      v.draft = GmailApp.createDraft(v.mail.recipient, v.mail.subject, v.mail.body, v.mail.options);
      v.draftId = v.draft.getId();
      GmailApp.getDraft(v.draftId).send();
    }
    console.log('Mail Remaining Daily Quota:'+MailApp.getRemainingDailyQuota());

    console.log(v.whois+' normal end.\n',v.rv);
    return v.rv;

  } catch(e){
    console.error(v.whois+' abnormal end(step.'+v.step+').',e,v);
    return e;
  }
}

